/* global AWS */
(function () {
  'use strict';

  angular
    .module('sjs.services.photo', [])
    .service('PhotoService', PhotoService);
  PhotoService.$inject = ['$q', '$cordovaCamera'];
  function PhotoService($q, $cordovaCamera) {
    // hoisted functions
    this.getPhotoURI = getPhotoURI;
    this.getPhotoData = getPhotoData;
    this.getPhoto = getPhoto;

    function getPhotoURI(tw, th, quality, source) {
      return getPhoto(tw, th, quality, source, "FILE_URI");
    }

    function getPhotoData(tw, th, quality, source) {
      return getPhoto(tw, th, quality, source, "DATA_URL");
    }

    function getPhoto(tw, th, quality, source, destinationType) {
      return $q(function (resolve, reject) {
        if (!!window.cordova) {
          // Then lets use the camera plugin to get a new photo
          if (!quality) { quality = 95; }
          if (destinationType == 'FILE_URI') {
            destinationType = Camera.DestinationType.FILE_URI;
          } else {
            destinationType = Camera.DestinationType.DATA_URL;
          }
          if (!source || source == 'CAMERA') {
            source = Camera.PictureSourceType.CAMERA;
          } else {
            source = Camera.PictureSourceType.PHOTOLIBRARY;
          }
          var options = {
            quality: quality,
            destinationType: destinationType,
            sourceType: source ? source : Camera.PictureSourceType.PHOTOLIBRARY,
            allowEdit: false,
            encodingType: Camera.EncodingType.JPEG,
            popoverOptions: CameraPopoverOptions,
            saveToPhotoAlbum: false,
            correctOrientation: true
          };
          console.log("options",options);
          if (!!tw) {
            options.targetWidth = tw;
          }
          if (!!th) {
            options.targetHeight = th;
          }

          $cordovaCamera.getPicture(options).then(resolve, reject);
        } else {
          // then return a dummy photo in base64 format
          resolve(getDummyPhoto());
        }
      });
    }

    function getDummyPhoto() {
      return "data:image/jpeg;base64,";
    }

  }
})();
